import TextInput from './TextInput';

const Form = () => {
    return (
        <div>
            <div className='row'>
                <TextInput 
                    type='height' 
                    text='Your height: '
                    placeholder='Your height in cms' />
            </div>
            <div className='row'>
                <TextInput 
                    type='weight' 
                    text='Your weight:'
                    placeholder='Your weight in kgs' 
                />
            </div>
        </div>
    );
}

export default Form;
